// combined-storybook.test.js
const { readFileSync, existsSync } = require('fs');
const { join } = require('path');
const { 
  runCombinedStorybookGenerator,
  createEnhancedCombinedStorybook 
} = require('../dist/combined-storybook-generator');

/**
 * Comprehensive tests for the Enhanced Combined Storybook Generator
 * Tests scene-by-scene animation triggers, timing coordination, and visual enhancements
 */

const SAMPLES_DIR = join(__dirname, '..', 'samples');

describe('Enhanced Combined Storybook Generator', () => {
  let enhancedSvgContent;
  let legacySvgContent;
  
  beforeAll(async () => {
    // Generate the enhanced combined storybook
    await runCombinedStorybookGenerator();
    
    // Read the generated files
    const enhancedPath = join(SAMPLES_DIR, 'enhanced-combined-storybook.svg');
    const legacyPath = join(SAMPLES_DIR, 'graph-generated-combined-storybook.svg');
    
    expect(existsSync(enhancedPath)).toBe(true);
    expect(existsSync(legacyPath)).toBe(true);
    
    enhancedSvgContent = readFileSync(enhancedPath, 'utf-8');
    legacySvgContent = readFileSync(legacyPath, 'utf-8');
  });

  describe('File Generation', () => {
    test('should generate enhanced combined storybook SVG file', () => {
      expect(enhancedSvgContent).toBeDefined();
      expect(enhancedSvgContent.length).toBeGreaterThan(1000);
    });

    test('should generate legacy combined storybook SVG file for backward compatibility', () => {
      expect(legacySvgContent).toBeDefined();
      expect(legacySvgContent.length).toBeGreaterThan(1000);
    });

    test('enhanced SVG should be valid XML', () => {
      expect(enhancedSvgContent).toContain('<?xml version="1.0" encoding="UTF-8"?>');
      expect(enhancedSvgContent).toContain('<svg');
      expect(enhancedSvgContent).toContain('</svg>');
    });
  });

  describe('Enhanced Animation Features', () => {
    test('should include unified bus sprite definition', () => {
      expect(enhancedSvgContent).toContain('id="unified-bus-sprite"');
      expect(enhancedSvgContent).toContain('<!-- Bus body -->');
      expect(enhancedSvgContent).toContain('<!-- Wheels -->');
      expect(enhancedSvgContent).toContain('<!-- Headlights -->');
    });

    test('should include coordinated bus animation', () => {
      expect(enhancedSvgContent).toContain('id="unified-coordinated-bus"');
      expect(enhancedSvgContent).toContain('animateTransform');
      expect(enhancedSvgContent).toContain('type="translate"');
      expect(enhancedSvgContent).toContain('values=');
      expect(enhancedSvgContent).toContain('dur="60s"');
    });

    test('should include scene timing indicators', () => {
      expect(enhancedSvgContent).toContain('class="scene-progress"');
      expect(enhancedSvgContent).toContain('animate attributeName="width"');
      expect(enhancedSvgContent).toContain('values="0;20;20;0"');
    });

    test('should include progress bar animation', () => {
      expect(enhancedSvgContent).toContain('class="progress-bar"');
      expect(enhancedSvgContent).toContain('progress-fill 60s linear');
      expect(enhancedSvgContent).toContain('url(#progress-gradient)');
    });

    test('should include connection paths between scenes', () => {
      expect(enhancedSvgContent).toContain('class="connection-path"');
      expect(enhancedSvgContent).toContain('stroke-dasharray: 5,5');
      expect(enhancedSvgContent).toContain('dash-flow 2s linear infinite');
    });
  });

  describe('Scene Coordination', () => {
    test('should have 6 scenes with proper positioning', () => {
      // Check for all 6 scenes
      for (let i = 1; i <= 6; i++) {
        expect(enhancedSvgContent).toContain(`class="scene-${i}"`);
        expect(enhancedSvgContent).toContain(`Scene ${i}:`);
      }
    });

    test('should include scene highlighting CSS', () => {
      expect(enhancedSvgContent).toContain('.scene-1 {');
      expect(enhancedSvgContent).toContain('transition: all 0.5s ease-in-out');
      expect(enhancedSvgContent).toContain('.active {');
      expect(enhancedSvgContent).toContain('border: 3px solid #8b5cf6');
      expect(enhancedSvgContent).toContain('box-shadow: 0 0 20px rgba(139, 92, 246, 0.3)');
    });

    test('should have proper scene clipping', () => {
      for (let i = 1; i <= 6; i++) {
        expect(enhancedSvgContent).toContain(`id="scene-${i}-clip"`);
        expect(enhancedSvgContent).toContain(`clip-path="url(#scene-${i}-clip)"`);
      }
    });
  });

  describe('Bus Animation Coordination', () => {
    test('should have coordinated bus animation values', () => {
      // Look specifically for the unified bus animation
      const busAnimationMatch = enhancedSvgContent.match(/id="unified-coordinated-bus"[\s\S]*?values="([^"]+)"/);
      expect(busAnimationMatch).toBeTruthy();

      if (busAnimationMatch) {
        const animationPath = busAnimationMatch[1];
        const coordinates = animationPath.split(';').map(coord => coord.trim());

        // Should have multiple coordinates for scene-by-scene travel
        expect(coordinates.length).toBeGreaterThanOrEqual(6);

        // Each coordinate should be in format "x,y"
        coordinates.forEach(coord => {
          if (coord) {
            expect(coord).toMatch(/^-?\d+,-?\d+$/);
          }
        });
      }
    });

    test('should have spinning wheel animations in bus sprite', () => {
      expect(enhancedSvgContent).toContain('id="front-wheel"');
      expect(enhancedSvgContent).toContain('id="rear-wheel"');
      expect(enhancedSvgContent).toContain('type="rotate"');
      expect(enhancedSvgContent).toContain('values="0;360"');
      expect(enhancedSvgContent).toContain('dur="1s"');
      expect(enhancedSvgContent).toContain('repeatCount="indefinite"');
    });

    test('should have headlight glow animations', () => {
      expect(enhancedSvgContent).toContain('animate attributeName="opacity"');
      expect(enhancedSvgContent).toContain('values="0.8;1;0.8"');
      expect(enhancedSvgContent).toContain('dur="2s"');
    });
  });

  describe('Visual Enhancements', () => {
    test('should include enhanced title and description', () => {
      expect(enhancedSvgContent).toContain('EventRouter Journey: Enhanced Combined Storybook');
      expect(enhancedSvgContent).toContain('Enhanced with Scene-by-Scene Animation Coordination');
    });

    test('should include glow filter for scene highlighting', () => {
      expect(enhancedSvgContent).toContain('id="scene-glow"');
      expect(enhancedSvgContent).toContain('feGaussianBlur');
      expect(enhancedSvgContent).toContain('feMerge');
    });

    test('should include progress gradient definition', () => {
      expect(enhancedSvgContent).toContain('id="progress-gradient"');
      expect(enhancedSvgContent).toContain('stop-color:#8b5cf6');
      expect(enhancedSvgContent).toContain('stop-color:#3b82f6');
    });

    test('should include playback controls if enabled', () => {
      expect(enhancedSvgContent).toContain('id="playback-controls"');
      expect(enhancedSvgContent).toContain('Click to Play/Pause');
    });
  });

  describe('Timing Configuration', () => {
    test('should have configurable total duration', () => {
      expect(enhancedSvgContent).toContain('dur="60s"');
    });

    test('should support loop configuration', () => {
      expect(enhancedSvgContent).toContain('repeatCount="indefinite"');
    });

    test('should have staggered scene start times', () => {
      // Scene timing indicators should have different begin times
      const beginMatches = enhancedSvgContent.match(/begin="(\d+)s"/g);
      expect(beginMatches).toBeTruthy();
      
      if (beginMatches && beginMatches.length > 1) {
        const beginTimes = beginMatches.map(match => {
          const timeMatch = match.match(/begin="(\d+)s"/);
          return timeMatch ? parseInt(timeMatch[1]) : 0;
        });
        
        // Times should be different (staggered)
        const uniqueTimes = [...new Set(beginTimes)];
        expect(uniqueTimes.length).toBeGreaterThan(1);
      }
    });
  });

  describe('Backward Compatibility', () => {
    test('legacy SVG should maintain original structure', () => {
      expect(legacySvgContent).toContain('EventRouter Journey: Graph-Generated Storybook');
      expect(legacySvgContent).toContain('Six Scenes Generated from Graph Configurations');
    });

    test('legacy SVG should have all 6 scenes', () => {
      for (let i = 1; i <= 6; i++) {
        expect(legacySvgContent).toContain(`Scene ${i}:`);
      }
    });

    test('legacy SVG should not include enhanced animation features', () => {
      expect(legacySvgContent).not.toContain('unified-coordinated-bus');
      expect(legacySvgContent).not.toContain('scene-progress');
      expect(legacySvgContent).not.toContain('progress-bar');
    });
  });

  describe('Error Handling', () => {
    test('should handle missing scene files gracefully', () => {
      // This test ensures the generator doesn't crash on missing files
      // The actual implementation should handle this case
      expect(enhancedSvgContent).toBeDefined();
    });

    test('should generate valid SVG even with animation errors', () => {
      // Ensure the SVG structure is valid even if some animations fail
      expect(enhancedSvgContent).toContain('<svg');
      expect(enhancedSvgContent).toContain('</svg>');
      expect(enhancedSvgContent.split('<svg').length - 1).toBeGreaterThanOrEqual(1);
      expect(enhancedSvgContent.split('</svg>').length - 1).toBeGreaterThanOrEqual(1);
    });
  });
});

const { graphToSVG } = require('../dist/svg-export');
const fs = require('fs');
const path = require('path');

describe('Slide 01 Graph Specifications', () => {
  const slide01Dir = path.join(__dirname, '..', 'samples', 'slide-01');
  let indexData;
  
  beforeAll(() => {
    // Load the index file
    const indexPath = path.join(slide01Dir, 'index.json');
    expect(fs.existsSync(indexPath)).toBe(true);
    indexData = JSON.parse(fs.readFileSync(indexPath, 'utf-8'));
  });

  test('should have valid index file structure', () => {
    expect(indexData).toHaveProperty('title');
    expect(indexData).toHaveProperty('description');
    expect(indexData).toHaveProperty('source');
    expect(indexData).toHaveProperty('generated');
    expect(indexData).toHaveProperty('graphs');
    expect(Array.isArray(indexData.graphs)).toBe(true);
    expect(indexData.graphs.length).toBe(8);
  });

  test('should reference slide-01-manifest as source', () => {
    expect(indexData.source).toContain('plugin-integration-slides.json');
    expect(indexData.title).toContain('Plugin Scaffolding & Manifest');
  });

  describe('Individual Graph Files', () => {
    indexData?.graphs?.forEach(graphInfo => {
      describe(`${graphInfo.name}`, () => {
        let graph;
        let jsonPath;
        let svgPath;

        beforeAll(() => {
          jsonPath = path.join(slide01Dir, graphInfo.file);
          svgPath = path.join(slide01Dir, graphInfo.svg);
          
          expect(fs.existsSync(jsonPath)).toBe(true);
          expect(fs.existsSync(svgPath)).toBe(true);
          
          graph = JSON.parse(fs.readFileSync(jsonPath, 'utf-8'));
        });

        test('should have valid graph structure', () => {
          expect(graph).toHaveProperty('nodes');
          expect(graph).toHaveProperty('edges');
          expect(graph).toHaveProperty('meta');
          expect(Array.isArray(graph.nodes)).toBe(true);
          expect(Array.isArray(graph.edges)).toBe(true);
        });

        test('should match index metadata', () => {
          expect(graph.nodes.length).toBe(graphInfo.nodes);
          expect(graph.edges.length).toBe(graphInfo.edges);
          expect(graph.meta.layout).toBe(graphInfo.layout);
          expect(graph.meta.theme).toBe(graphInfo.theme);
        });

        test('should have description and source metadata', () => {
          expect(graph).toHaveProperty('description');
          expect(graph).toHaveProperty('source');
          expect(graph.description).toBe(graphInfo.description);
          expect(graph.source).toContain('slide-01-manifest');
        });

        test('should generate valid SVG', () => {
          expect(() => graphToSVG(graph)).not.toThrow();
          
          const svg = graphToSVG(graph);
          expect(svg).toContain('<?xml version="1.0" encoding="UTF-8"?>');
          expect(svg).toContain('<svg');
          expect(svg).toContain('</svg>');
          expect(svg).toContain('xmlns="http://www.w3.org/2000/svg"');
        });

        test('should have valid node IDs and labels', () => {
          graph.nodes.forEach(node => {
            expect(node).toHaveProperty('id');
            expect(node).toHaveProperty('label');
            expect(typeof node.id).toBe('string');
            expect(typeof node.label).toBe('string');
            expect(node.id.length).toBeGreaterThan(0);
            expect(node.label.length).toBeGreaterThan(0);
          });
        });

        test('should have valid edges with existing node references', () => {
          const nodeIds = new Set(graph.nodes.map(n => n.id));
          
          graph.edges.forEach(edge => {
            expect(edge).toHaveProperty('from');
            expect(edge).toHaveProperty('to');
            expect(nodeIds.has(edge.from)).toBe(true);
            expect(nodeIds.has(edge.to)).toBe(true);
            
            if (edge.label) {
              expect(typeof edge.label).toBe('string');
              expect(edge.label.length).toBeGreaterThan(0);
            }
          });
        });

        test('generated SVG file should match programmatic generation', () => {
          const generatedSVG = graphToSVG(graph);
          const fileSVG = fs.readFileSync(svgPath, 'utf-8');
          
          // Compare key structural elements (allowing for minor formatting differences)
          expect(fileSVG).toContain('<?xml version="1.0" encoding="UTF-8"?>');
          expect(fileSVG).toContain('<svg');
          expect(fileSVG).toContain('</svg>');
          
          // Check that all nodes are represented
          graph.nodes.forEach(node => {
            expect(fileSVG).toContain(node.label);
            expect(fileSVG).toContain(`data-id="${node.id}"`);
          });
          
          // Check that all edges are represented
          graph.edges.forEach(edge => {
            if (edge.label) {
              expect(fileSVG).toContain(edge.label);
            }
          });
        });
      });
    });
  });

  describe('Graph Content Validation', () => {
    test('plugin-package-structure should represent sub-elements correctly', () => {
      const graph = JSON.parse(fs.readFileSync(path.join(slide01Dir, 'plugin-package-structure.json'), 'utf-8'));
      
      const expectedNodes = ['package-box', 'shadow', 'label', 'glyphs', 'npm-badge'];
      const actualNodes = graph.nodes.map(n => n.id);
      
      expectedNodes.forEach(nodeId => {
        expect(actualNodes).toContain(nodeId);
      });
      
      // Should have package-box as the central element
      const packageBoxEdges = graph.edges.filter(e => e.from === 'package-box');
      expect(packageBoxEdges.length).toBeGreaterThan(0);
    });

    test('slide-01-architecture should represent main elements', () => {
      const graph = JSON.parse(fs.readFileSync(path.join(slide01Dir, 'slide-01-architecture.json'), 'utf-8'));
      
      const expectedElements = ['plugin-package', 'plugin-manifest', 'handlers-export', 'build-publish', 'host-sdk'];
      const actualNodes = graph.nodes.map(n => n.id);
      
      expectedElements.forEach(elementId => {
        expect(actualNodes).toContain(elementId);
      });
    });

    test('plugin-workflow should represent development process', () => {
      const graph = JSON.parse(fs.readFileSync(path.join(slide01Dir, 'plugin-workflow.json'), 'utf-8'));
      
      const workflowSteps = ['scaffold', 'define-manifest', 'implement-handlers', 'build-package', 'publish-npm', 'host-discovery'];
      const actualNodes = graph.nodes.map(n => n.id);
      
      workflowSteps.forEach(stepId => {
        expect(actualNodes).toContain(stepId);
      });
      
      // Should be a linear workflow (layered layout)
      expect(graph.meta.layout).toBe('layered');
    });

    test('plugin-capabilities should use radial layout for capabilities', () => {
      const graph = JSON.parse(fs.readFileSync(path.join(slide01Dir, 'plugin-capabilities.json'), 'utf-8'));
      
      expect(graph.meta.layout).toBe('radial');
      
      // Should have plugin-core as central node
      const coreNode = graph.nodes.find(n => n.id === 'plugin-core');
      expect(coreNode).toBeDefined();
      
      // Should have capability nodes connected to core
      const capabilityEdges = graph.edges.filter(e => e.from === 'plugin-core');
      expect(capabilityEdges.length).toBeGreaterThan(0);
    });
  });
});

const fs = require('fs');
const path = require('path');

function escapeRegExp(string) {
  return string.replace(/[.*+?^${}()|[\]\\]/g, '\\$&');
}

describe('Slide-driven composition validation', () => {
  const slidesJsonPath = path.join(__dirname, '../assets/plugin-architecture/plugin-integration-slides.json');
  const slides = JSON.parse(fs.readFileSync(slidesJsonPath, 'utf8'));

  const slide = slides.slides.find(s => s.id === 'slide-01-manifest');
  if (!slide) throw new Error('slide-01-manifest not found in plugin-integration-slides.json');

  const targetElements = new Set(['plugin-package', 'plugin-manifest', 'handlers-export', 'host-sdk']);

  function getExpectedSubs(el) {
    if (el.spec) {
      const specPath = path.join(__dirname, '../assets/plugin-architecture', el.spec);
      const spec = JSON.parse(fs.readFileSync(specPath, 'utf8'));
      return spec.sub_elements || [];
    }
    return el.sub_elements || [];
  }

  slide.elements
    .filter(el => targetElements.has(el.id))
    .forEach(el => {
      test(`${el.id} integrated SVG should include sub-elements at specified coordinates`, () => {
        const integratedSvgPath = path.join(__dirname, '../assets/plugin-architecture', el.svg);
        const content = fs.readFileSync(integratedSvgPath, 'utf8');

        const expectedSubs = getExpectedSubs(el);
        expectedSubs.forEach(sub => {
          expect(sub.compose).toBeDefined();
          const expectedHref = `${sub.svg.replace('slide-01-manifest/', '')}#${sub.id}`;

          const hasTransform = sub.compose && typeof sub.compose.transform === 'string';
          const subIdPattern = new RegExp(`<g[^>]*data-sub-id=\"${escapeRegExp(sub.id)}\"[^>]*>`);

          if (hasTransform) {
            const patternHrefThenTransform = new RegExp(`<use[\\s\\S]*?xlink:href=\"${escapeRegExp(expectedHref)}\"[\\s\\S]*?transform=\"${escapeRegExp(sub.compose.transform)}\"[\\s\\S]*?>`);
            const patternTransformThenHref = new RegExp(`<use[\\s\\S]*?transform=\"${escapeRegExp(sub.compose.transform)}\"[\\s\\S]*?xlink:href=\"${escapeRegExp(expectedHref)}\"[\\s\\S]*?>`);
            const patternInline = new RegExp(`<g[\\s\\S]*?data-sub-id=\"${escapeRegExp(sub.id)}\"[\\s\\S]*?transform=\"${escapeRegExp(sub.compose.transform)}\"[\\s\\S]*?>`);
            const okInline = content.includes(`data-sub-id="${sub.id}"`) && content.includes(`transform="${sub.compose.transform}"`);
            expect(patternHrefThenTransform.test(content) || patternTransformThenHref.test(content) || patternInline.test(content) || okInline).toBe(true);
          } else {
            expect(typeof sub.compose.x).toBe('number');
            expect(typeof sub.compose.y).toBe('number');
            const pattern1 = new RegExp(`<use[\\s\\S]*?xlink:href=\"${escapeRegExp(expectedHref)}\"[\\s\\S]*?x=\"${sub.compose.x}\"[\\s\\S]*?y=\"${sub.compose.y}\"[\\s\\S]*?>`);
            const pattern2 = new RegExp(`<use[\\s\\S]*?xlink:href=\"${escapeRegExp(expectedHref)}\"[\\s\\S]*?y=\"${sub.compose.y}\"[\\s\\S]*?x=\"${sub.compose.x}\"[\\s\\S]*?>`);
            const pattern3 = new RegExp(`<use[\\s\\S]*?x=\"${sub.compose.x}\"[\\s\\S]*?y=\"${sub.compose.y}\"[\\s\\S]*?xlink:href=\"${escapeRegExp(expectedHref)}\"[\\s\\S]*?>`);
            const pattern4 = new RegExp(`<use[\\s\\S]*?y=\"${sub.compose.y}\"[\\s\\S]*?x=\"${sub.compose.x}\"[\\s\\S]*?xlink:href=\"${escapeRegExp(expectedHref)}\"[\\s\\S]*?>`);
            const patternInline = new RegExp(`<g[\\s\\S]*?data-sub-id=\"${escapeRegExp(sub.id)}\"[\\s\\S]*?transform=\"translate\(${sub.compose.x},${sub.compose.y}\)\"[\\s\\S]*?>`);
            const okInline = content.includes(`data-sub-id="${sub.id}"`) && content.includes(`transform="translate(${sub.compose.x},${sub.compose.y})"`);
            expect(pattern1.test(content) || pattern2.test(content) || pattern3.test(content) || pattern4.test(content) || patternInline.test(content) || okInline).toBe(true);
          }
        });
      });
    });
});

